(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[36166],{36166:function(o){"use strict";o.exports=JSON.parse('{"Ps":{"Q":["**All investing involves risk.**","**Brokerage services** are offered through Robinhood Financial LLC, (\u201c**RHF**\u201d) a registered broker dealer (member [SIPC](https://www.sipc.org/)), and clearing services through Robinhood Securities, LLC, (\u201c**RHS**\u201d) a registered broker dealer (member [SIPC](https://www.sipc.org/)).","**Futures and cleared swaps trading** is offered by Robinhood Derivatives, LLC, (\u201cRHD\u201d) a registered futures commission merchant with the Commodity Futures Trading Commission (CFTC) and a Member of the National Futures Association (NFA). RHD is not FDIC insured or SIPC protected.","**Cryptocurrency services** are offered through an account with Robinhood Crypto, LLC (\u201cRHC\u201d) (NMLS ID: 1702840). Robinhood Crypto is licensed to engage in virtual currency business activity by the New York State Department of Financial Services. Review a list of [RHC\'s licenses](https://cdn.robinhood.com/assets/robinhood/legal/RHC%20Licenses%20and%20Disclosures.pdf) for more information. Cryptocurrency held through Robinhood Crypto is not FDIC insured or SIPC protected.","**The Robinhood spending account** is offered through Robinhood Money, LLC (\u201cRHY\u201d) (NMLS ID: 1990968), a licensed money transmitter. Review a [list of our licenses](https://cdn.robinhood.com/assets/robinhood/legal/rhy-licenses-and-disclosures.pdf) for more information.","**The Robinhood Cash Card** is a prepaid card issued by Sutton Bank, Member FDIC, pursuant to a license from Mastercard\xae International Incorporated. Mastercard and the circles design are registered trademarks of Mastercard International Incorporated.","**Robinhood Gold Card** is subject to credit approval and underwriting. Robinhood Gold Card is offered by Robinhood Credit, Inc., and is issued by Coastal Community Bank, pursuant to a license from Visa U.S.A. Inc. Robinhood Credit, Inc. (\u201cRCT\u201d), is a financial technology company, not a bank.","**Robinhood Gold** is a subscription-based membership program of premium services offered through Robinhood Gold, LLC (\u201c**RHG**\u201d).","RHF, RHY, RHC, RCT, RHG, RHD, and RHS are affiliated entities and wholly owned subsidiaries of Robinhood Markets, Inc. RHF, RHY, RHC, RCT, RHG, RHD, and RHS are not banks. Investing products offered by RHF are not FDIC insured and involve risk, including possible loss of principal.","RHY is not a member of FINRA, and products are not subject to SIPC protection, but funds held in the Robinhood spending account and Robinhood Cash Card account may be eligible for FDIC pass-through insurance (review the [Robinhood Cash Card Agreement](https://cdn.robinhood.com/assets/robinhood/legal/robinhood-money-prepaid-debit-card-agreement.pdf) and the [Robinhood Spending Account Agreement](https://cdn.robinhood.com/assets/robinhood/legal/robinhood-money-spending-account-agreement.pdf)).","Options trading entails significant risk and is not appropriate for all customers. Customers must read and understand the [Characteristics and Risks of Standardized Options](https://cdn.robinhood.com/assets/robinhood/legal/Characteristics%20and%20Risks%20of%20Standardized%20Options.pdf) before engaging in any options trading strategies. Options transactions are often complex and may involve the potential of losing the entire investment in a relatively short period of time. Certain complex options strategies carry additional risk, including the potential for losses that may exceed the original investment amount.","RO 4146192"]},"HR":{"Q":["All investing involves risk and a loss of principal is possible.","Robinhood U.K. Ltd (Robinhood UK) is authorised and regulated by the Financial Conduct Authority (FRN: 823590). Robinhood UK onboards UK customers and has the lead customer relationship with UK customers in relation to their use of the Robinhood UK app and website. Robinhood UK introduces UK customers to Robinhood Securities, LLC for order routing, execution, clearing, settlement, arranging custody services, securities lending, and margin investing to eligible UK customers with margin accounts. In relation to margin investing, Robinhood U.K. is acting as credit broker and not a lender. Margin is provided by Robinhood Securities, LLC. Robinhood U.K. can only introduce you to Robinhood Securities, LLC for margin investing. Margin investing, stock lending and options trading are optional products and subject to Robinhood\'s eligibility and appropriateness criteria.","Robinhood Securities, LLC is regulated in the U.S. by the SEC and FINRA. Robinhood UK and Robinhood Securities, LLC are subsidiaries of Robinhood Markets, Inc.","Robinhood U.K. Ltd is a private limited company registered in England and Wales (09908051).","Robinhood does not provide investment advice. Individual investors should make their own decisions.","Commission-free trading of stocks refers to $0 commissions for Robinhood self-directed individual brokerage accounts that trade U.S. listed securities and ADRs. Keep in mind, other costs such as regulatory fees may apply to your brokerage account. Review [Robinhood UK\u2019s Fee Schedule](https://cdn.robinhood.com/assets/robinhood/legal/RHUK_Fee_Schedule.pdf) to learn more.","[UK Privacy policy](https://robinhood.com/gb/en/support/articles/privacy-policy/)"],"o":["Robinhood means Robinhood Markets, Inc. and its wholly owned subsidiaries, which includes Robinhood U.K. Ltd (\u201cRobinhood UK\u201d), Robinhood Securities, LLC (**Robinhood Securities**\u201d) and Say Technologies, LLC (\u201c**SAY**\u201d).","All investments involve risk and loss of capital is possible.","Robinhood U.K. Ltd (Robinhood UK) is authorised and regulated by the Financial Conduct Authority (FRN: 823590). Robinhood UK onboards UK customers and has the lead customer relationship with UK customers in relation to their use of the Robinhood UK app and website. Robinhood UK introduces UK customers to Robinhood Securities, LLC for order routing, execution, clearing, settlement, arranging custody services, securities lending, and margin investing to eligible UK customers with margin accounts. In relation to margin investing, Robinhood U.K. is acting as credit broker and not a lender. Margin is provided by Robinhood Securities, LLC. Robinhood U.K. can only introduce you to Robinhood Securities, LLC for margin investing. Margin investing, stock lending and options trading are optional products and subject to Robinhood\'s eligibility and appropriateness criteria.","Robinhood Securities is regulated in the US by the SEC and FINRA. Robinhood UK and Robinhood Securities are subsidiaries of Robinhood Markets, Inc.","Robinhood Securities is a member of the Securities Investor Protection Corporation (\u201c**SIPC**\u201d), which protects securities customers of its members up to $500,000 (including $250,000 for claims for cash). Explanatory brochure available upon request or at [www.sipc.org](https://www.sipc.org).","UK brokerage customers participate by default in the Brokerage Cash Sweep Program (the IntraFi Network Deposit (IND) Sweep Program) and will have their eligible uninvested brokerage account cash automatically swept or moved into deposits at a network of program banks. Cash deposited at these banks will be eligible for Federal Deposit Insurance Corporation (\u201c**FDIC**\u201d) insurance up to a total maximum of $2.25 million or $250,000 per program bank (of which $2,000 is reserved for accrued interest at each such bank), inclusive of any other deposits you may already hold at the bank in the same ownership capacity. If you choose to opt out of one or more program banks, your maximum FDIC insurance coverage may be reduced. You will be able to opt out of the program, in which case your uninvested cash will not earn interest and will be protected under SIPC. Read the [SIPC, FDIC and Account Protection Disclosure](https://cdn.robinhood.com/assets/robinhood/legal/SIPC_FDIC_and_Account_Protection_UK.pdf) for further information.","The UK\u2019s Financial Services Compensation Scheme (FSCS) does not apply.","Commission-free trading of stocks refers to $0 commissions for self-directed individual brokerage accounts that trade U.S. listed securities and certain OTC securities electronically. Keep in mind that other costs, including regulatory fees, apply to your brokerage account. Review Robinhood UK\u2019s [Fee Schedule](https://cdn.robinhood.com/assets/robinhood/legal/RHUK_Fee_Schedule.pdf) to learn more.","Robinhood UK offers services to customers that are over 18 years old, have a National Insurance number and are a resident and (income) tax resident of the United Kingdom (\u201c**UK**\u201d) and are not a US person. This is not an offer, solicitation of an offer, or advice to buy or sell securities, or open a brokerage account outside of the UK.","Third-party information provided for product features, communications, and communications emanating from social media communities, market prices, data and other information available through Robinhood Markets, Inc. or any of its subsidiaries or affiliates are meant for informational purposes only and are not intended as an offer or solicitation for the purchase or sale of any financial instrument or crypto or as an official confirmation of any transaction. The information provided is not warranted as to completeness or accuracy and is subject to change without notice.","Investors should be aware that system response, execution price, speed, liquidity, market data, and account access times are affected by many factors, including market volatility, size and type of order, market conditions, system performance, and other factors.","All investments involve risk and the past performance of a security or financial product does not guarantee future results or returns. There is always the potential of losing money when you invest in securities, or other financial products. Please note that changes to the exchange rate may impact the GBP value of your USD holdings (cash and securities) when they are converted to GBP. Investors should consider their investment objectives and risks carefully before investing.","Reference No. 4512776"]},"GK":{"Q":["Crypto markets are highly volatile, and trading or holding crypto can lead to loss of your assets. Crypto is not legal tender, and is not backed by any government or covered by any government compensation scheme.","Robinhood Europe, UAB (\u201cRHEU\u201d) (company code: 306377915) is authorized and regulated by the Bank of Lithuania (\u201cBoL\u201d) as a financial brokerage firm and a crypto-asset service provider. RHEU\u2019s registered address is: M\u0117sini\u0173 5, LT-01133 Vilnius, Lithuania; address for correspondence: Konstitucijos pr, 21A (QUADRUM East), LT-08130, Vilnius, Lithuania. RHEU\u2019s corporate data is collected and stored with the Register of Legal Entities of the Republic of Lithuania."]}}')}}]);